                },
                methods: {
                    getNumber(ticketId, numberId) {
                        if (this[this.current_type][this.current_period].tickets[ticketId] !== undefined && this[this.current_type][this.current_period].tickets[ticketId][numberId] !== undefined) {
                            return this[this.current_type][this.current_period].tickets[ticketId][numberId];
                        }
                        return null;
                    },
                    getTicket(ticketId) {
                        if (this[this.current_type][this.current_period].tickets[ticketId] !== undefined) {
                            return this[this.current_type][this.current_period].tickets[ticketId];
                        }
                        return null;
                    },
                    addTicket() {
                        this[this.current_type][this.current_period].tickets.push([]);
                    },
                    setNumber(ticketId, numberId, number) {
                        this.$set(this[this.current_type][this.current_period].tickets[ticketId], numberId, number);
                    },
                    numbersArray() {
                        return Array.from(Array(this[this.current_type][this.current_period].numbers), (_, i) => {
                            i = i + 1;
                            if (i < 10) {
                                i = '0' + i;
                            }
                            return String(i);
                        });
                    },
                    getNumberChoose(ticketId) {
                        var quantity = this[this.current_type][this.current_period].tickets[ticketId].reduce(function (accumulator, value) {
                            if (value) {
                                return accumulator + 1;
                            }
                        }, 0);
                        return quantity;
                    },
                    removeTicket(ticketId) {
                        this[this.current_type][this.current_period].tickets = this[this.current_type][this.current_period].tickets.filter(function (value, index) {
                            return index != ticketId;
                        });
                    },
                    autoNumbers(ticketId) {
                        var arr = [];
                        while (arr.length < this[this.current_type][this.current_period].number_choose) {
                            var r = Math.floor(Math.random() * this[this.current_type][this.current_period].numbers) + 1;
                            if (r < 10) {
                                r = "0" + r;
                            }
                            if (arr.indexOf(r) === -1) arr.push(String(r));
                        }
                        this.$set(this[this.current_type][this.current_period].tickets, ticketId, arr);
                    }
                },
                computed: {
                    _tickets: function () {
                        return this[this.current_type][this.current_period].tickets;
                    },
                    _number_choose: function () {
                        return this[this.current_type][this.current_period].number_choose;
                    },
                    _total_quantity: function () {
                        // $total_price = 0;
                        //
                        // if ($param['type'] === config('constants.ticket.type.standard')) {
                        //     $total_price = count($param['ticket_number']) * $checkGame->price;
                        // } else {
                        //     $is_standard = false;
                        //     $total_price = ($this->adjust_the_convolution($checkGame->number_pick - (int)$param['type'], $checkGame->number_max - (int)$param['type'])) * $checkGame->price;
                        // }
                        var vm = this;
                        var total_quantity = this[this.current_type][this.current_period].tickets.reduce(function (accumulator, numbers) {
                            var quantity = numbers.reduce(function (accumulator, value) {
                                if (value) {
                                    return accumulator + 1;
                                }
                            }, 0);
                            if (quantity == vm[vm.current_type][vm.current_period].number_choose) return accumulator + 1;
                            return accumulator;
                        }, 0);
                        console.log(this._current_period);
                        if (this._current_type === 'standard') {
                            return total_quantity * this._current_period;
                        } else {
                            return total_quantity * ADJUST[this._current_type] * this._current_period;
                        }
                    },
                    _total_price: function () {
                        return this._total_quantity * this.price;
                    },
                    _tickets_buy: function () {
                        var vm = this;
                        var tickets = this[this.current_type][this.current_period].tickets.filter(function (ticket, ticketId) {
                            return vm.getNumberChoose(ticketId) == vm._number_choose;
                        });
                        var tickets_buy = {};
                        tickets_buy['type'] = this.current_type;
                        tickets_buy['period'] = this.current_period;
                        tickets_buy['tickets'] = tickets;
                        return JSON.stringify(tickets_buy['tickets']);
                    },
                    _ticket_amount: function () {
                        return this._total_quantity * this.price;
                    },
                    _current_type: function () {
                        return this.current_type;
                    },
                    _current_period: function () {
                        return this.current_period;
                    }
                }
            });

